request.description:
Get configuration paths based on version and payload.

    Expected JSON request format:
    {
        "version": 1,
        "payload": {
            "selectedVersions": [1],
            "selectedV": {"V1": "on", ...},
            "selectedF": {"F1": "on", ...},
            "calculationOption": "freeFlowNPV",
            "targetRow": 20,
            "SenParameters": {
                "S13": {
                    "enabled": true,
                    "mode": "percentage",
                    "values": [10],
                    ...
                },
                ...
            }
        }
    }

